// file inversify.config.ts

import { Container } from "inversify";
import { TYPES } from "./types";
import { Warrior, Weapon, ThrowableWeapon, NotificationsRepository } from "./interfaces";
import { Ninja, Katana, Shuriken, KpiRepositoryImpl, NotificationsRepositoryImpl } from "./entities";
import { KpiRepository } from "../repository/KpiRepository";

const myContainer = new Container();
myContainer.bind<Warrior>(TYPES.Warrior).to(Ninja);
myContainer.bind<KpiRepository>(TYPES.Repo).to(KpiRepositoryImpl);
myContainer.bind<NotificationsRepository>(TYPES.NotificationsRepository).to(NotificationsRepositoryImpl);
myContainer.bind<Weapon>(TYPES.Weapon).to(Katana);
myContainer.bind<ThrowableWeapon>(TYPES.ThrowableWeapon).to(Shuriken);
myContainer.bind<string>(TYPES.ApiBaseUrl).toConstantValue("http://localhost:8080/api/kpis");

export { myContainer };
